      table = ["「ちょっとこちらにきてもらえますか。」いきなり逮捕、拘束される。「反応表」を使用した角色は、このシーンが終わってから2シーンの間、自分がシーン玩家でないシーンに登場することができなくなる（マスターシーンには登場可能）。", "「私が協力できるのはここまでだ。」協力を求めた人物は、怯えたような様子で手に持った包みをあなたに押し付けた。「反応表」を使用した角色は、何か好きなアイテム一つを獲得する。", "「その件は捜査中です。情報提供ありがとうございます。」協力を求めた人物は、にこにこ笑って、そう答える。何を言っても、同じ返答しか返ってこない。「反応表」を使用した角色は、【正気度】を1点減少する。", "「もしかして、お前、あの事件の関係者か……？」どうやら協力を求めた人物も、ちょうど同じ事件を調査していたようだ。いろいろ情報を提供してくれるようだ。「反応表」を使用した角色は、以降、調査判定を行うときプラス1の修正がつく。", "「夢でも見たんじゃないですか？」どんなに強く訴えても信じてもらえない。……もしかして、おかしいのは私の方なのか？情動の特技分野からランダムに特技一つを選んで恐怖判定を行う。", "「はいはい。我々もヒマじゃないんだよ。」色々話しても相手にしてもらえない。門前払いを喰らう。", "「ちょっと身体検査よろしいでしょうか？」怪しい人物だと思われたらしい。「反応表」を使用した角色が、アイテムや、違法そうなプライズを持っていた場合、このシーンが終わってから2シーンの間、自分がシーン玩家でないシーンに登場することができなくなる（マスターシーンには登場可能）。", "「それは気になりますね。こちらでも調査してみましょう。」親身になって相談に乗ってくれる。何か分かったら連絡してくれると言うが……。1D6を振る。奇数なら、2シーン後に情報をくれる。「反応表」を使用した角色は、好きな【秘密】一つを獲得する。偶数なら調査していたNPCが謎の死を遂げる。「反応表」を使用した角色は、知識の特技分野からランダムに特技一つを選んで恐怖判定を行う。", "「命が惜しければこれ以上関わるな。」あなたは人気のない場所に連れていかれ、殴られた。協力を求めた人物は、助けを求めたはずのあなたを激しく拒絶する。「反応表」を使用した角色は、【生命力】を1点減少する。", "「分かりました。念のためパトロールを強化しましょう。」周辺の警護を約束してくれる。「反応表」を使用した角色は、このセッションの間、一度だけ自分が受けたダメージを無効化することができる。ダメージを無効化した場合、「反応表」を使用した角色は、暴力の特技分野からランダムに一つを選んで恐怖判定を行う。", "「……なんじゃこりゃぁっ！？」助けを求めた相手が突然死亡する。ヤツらの手は、こんなところまで及んでいるのか？「反応表」を使用した角色は、暴力の特技分野からランダムに一つを選んで恐怖判定を行う。"];
